import React from 'react';
import SelectSearch, { fuzzySearch } from 'react-select-search';

const Search = () => {
  return (
    <div>
      <SelectSearch
        options={countries}
        search
        filterOptions={fuzzySearch}
        emptyMessage={() => (
          <div style={{ textAlign: 'center', fontSize: '0.8em' }}>
            Not found renderer
          </div>
        )}
        placeholder="Select your country"
      />
    </div>
  );
}

export default Search;
